import React from 'react';
import NavBar from '../components/NavBar'
import { Button } from '@mui/material';
import { authFetch } from '../auth/AuthFunctions'

class Home extends React.Component {

    constructor(props) {
        super(props);
        this.testProtected = this.testProtected.bind(this);
        this.testAlert = this.testAlert.bind(this)
    }

    testProtected() {
        authFetch('/api/protected').then(resp => console.log(resp));
    }

    testAlert() {
        alert('wowza')
    }

    render() {
        return (
            <div>
                <NavBar />
                <h2>Home Page</h2>
                <Button onClick={() => this.testProtected()}>Test Protected API</Button>
                <Button onClick={() => this.testAlert()}>Test onClick</Button>
            </div>
        )
    }
}

export default Home;
